import React, { Component } from "react";
import img1 from "../../assets/imgs/img_lg--1.jpg";
export default class ImageGallery extends Component {
  constructor(props) {
    super(props);
    this.state = {
      imageList: [img1],
    };
  }
  render() {
    return <div className="ImageGallery"></div>;
  }
}
